import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import BoxRules from '../components/BoxRules';

import borobudurImg from '../assets/img/borobudur.png';

const DescriptionPage = () => {
    return (
      <div>
        <Navbar />

        <section className="description-flex">

          <div className="section content-description">
            <p className="destination">Destination</p>
            <h1>Candi Borobudur</h1>
            <p className="alamat">Jalan Raya Borobudur, Magelang, Jawa Tengah</p>
          </div>

        </section>

        <section>

          <img src={borobudurImg} className="index-DescriptionPage"/>
          <BoxRules className="index-BoxRules" />

        </section>

        <Footer />
      </div>
    );
}

export default DescriptionPage;
